import React, { useContext, useState } from "react";
import { bool } from 'prop-types';
import { StyledMenu } from './Form.styles';
import { Link, Outlet, useNavigate  } from "react-router-dom";



const Menu = ({ open }) => {

	const myContext = useContext(AppContext);
    const auth = myContext.auth;
    let admin = true; /* byt ut denna sen, checka om det 채r admin vid inlogg */
    let user = false; /* byt ut denna sen, checka om det 채r admin vid inlogg */

return (
    <StyledMenu open={open}>


		<Nav>
			<Link to="/home" > Hem </Link> 
			{admin &&
			<>
			<Link to="/admin" > Admin </Link> 
			<Link to="/account" > Hantera kunder </Link>
			</>
			}
			{user &&
			<>
			<Link to="/account" > Konto </Link>
			<Link to="/history" > Historik </Link>
			</>
			}
		</Nav>
		<Outlet/> {/* outlet renderar child  */}



      <a href="/">
        <span role="img" aria-label="about us">&#x1f481;&#x1f3fb;&#x200d;&#x2642;&#xfe0f;</span>
        About us
      </a>
      <a href="/">
        <span role="img" aria-label="price">&#x1f4b8;</span>
        Pricing
        </a>
      <a href="/">
        <span role="img" aria-label="contact">&#x1f4e9;</span>
        Contact
        </a>
    </StyledMenu>
  )
}
Menu.propTypes = {
  open: bool.isRequired,
}
export default Menu;
